class Home extends Component {

  constructor() {
    super();
    this.state = {
      help: null
    };


  }


  componentDidMount(){
  }

  helpButton(){
    this.setState({help:1})

  }

  render() {

const { lat, lng } = this.props;

    return (
<div className="p-4">

{lat}{"  "}{lng}

{this.state.help && (<OfferHelp />)}

<button className="btn btn-warning font-weight-bold text-uppercase w-100" onClick={this.helpButton()}>Render Help Button</button>
</div>

    );
  } 
}

export default Home;
